import React from 'react'

const QuickSelection = () => {

    const searches = [
        {
          from: "Siliguri",
          to: "Gangtok"
        },
        {
          from: "Siliguri",
          to: "Darjeeling"
        },
        {
          from: "Siliguri",
          to: "Kolkata"
        }
      ]
  return (

    
    <div className="max-w-7xl mx-auto p-6">
  <h2 className="text-3xl font-semibold mb-8 text-center text-gray-800">Quick Book</h2>
  
  <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 gap-6 justify-center">
    {searches.map((search, index) => (
      <div 
        key={index} 
        className="bg-white rounded-lg shadow-lg border border-gray-200 p-6 flex flex-col justify-center items-center"
      >
        <div className="min-h-[120px] flex flex-col justify-between items-center">
          <h3 className="text-2xl font-semibold text-gray-900 mb-4 text-center">
            {search.from} - {search.to}
          </h3>
          
          <div className="flex justify-center mt-4">
            <button className="bg-blue-600 text-white py-2 px-6 rounded-lg text-lg font-medium transition-colors duration-300 hover:bg-blue-700 focus:ring-2 focus:ring-blue-500 focus:ring-offset-2">
              Link
            </button>
          </div>
        </div>
      </div>
    ))}
  </div>
</div>

  )
}

export default QuickSelection
